CREATE VIEW public."VT_CP_PROYECTO_APARTADO_ESTATUS" AS
 SELECT row_number() OVER (ORDER BY apartadoinfo.id_proyecto DESC) AS id_secuencia,
    apartadoinfo.apartado,
    max(apartadoinfo.id_proyecto) AS id_proyecto,
    min(apartadoinfo.idllave) AS idllave,
    apartadoinfo.cs_estatus
   FROM (( SELECT 'Proyecto'::text AS apartado
        UNION
         SELECT 'Actividad'::text AS apartado
        UNION
         SELECT 'Producto'::text AS apartado
        UNION
         SELECT 'Presupuesto'::text AS apartado) apartadotempo
     LEFT JOIN ( SELECT 'Proyecto'::text AS apartado,
            met_cortoplazo_proyecto.id_proyecto,
            met_cortoplazo_proyecto.id_proyecto AS idllave,
            met_cortoplazo_proyecto.cs_estatus
           FROM public.met_cortoplazo_proyecto
          WHERE ((met_cortoplazo_proyecto.cs_estatus)::text <> 'B'::text)
        UNION ALL
         SELECT 'Actividad'::text AS apartado,
            mca.id_proyecto,
            mca.id_actividad AS idllave,
            mca.cs_estatus
           FROM public.met_cortoplazo_actividad mca
          WHERE (((mca.cs_estatus)::text <> 'B'::text) AND ((mca.cs_estatus)::text = ANY (ARRAY[('I'::character varying)::text, ('C'::character varying)::text])))
        UNION ALL
         SELECT tabactconproductos.apartado,
            tabactconproductos.id_proyecto,
            tabactconproductos.idllave,
                CASE
                    WHEN (tabactconproductos.contaproducto = 0) THEN 'I'::text
                    ELSE 'C'::text
                END AS csestatusactividad
           FROM ( SELECT 'Actividad'::text AS apartado,
                    mca.id_proyecto,
                    mca.id_actividad AS idllave,
                    mca.cs_estatus AS cs_estatusact,
                    ( SELECT count(mcpro.id_producto) AS count
                           FROM public.met_cortoplazo_producto mcpro
                          WHERE ((mca.id_actividad = mcpro.id_actividad) AND ((mcpro.cs_estatus)::text <> 'B'::text))) AS contaproducto,
                    'I'::text AS cs_estatuspro
                   FROM public.met_cortoplazo_actividad mca
                  WHERE ((mca.cs_estatus)::text = 'C'::text)) tabactconproductos
        UNION ALL
         SELECT 'Producto'::text AS apartado,
            ( SELECT DISTINCT mcap.id_proyecto
                   FROM public.met_cortoplazo_actividad mcap
                  WHERE (mcap.id_actividad = mcp.id_actividad)) AS id_proyecto,
            mcp.id_producto AS idllave,
            mcp.cs_estatus
           FROM public.met_cortoplazo_producto mcp
          WHERE ((mcp.id_actividad IN ( SELECT mca.id_actividad
                   FROM public.met_cortoplazo_actividad mca
                  WHERE (((mca.cs_estatus)::text <> 'B'::text) AND ((mca.cs_estatus)::text = ANY (ARRAY[('I'::character varying)::text, ('C'::character varying)::text]))))) AND ((mcp.cs_estatus)::text <> 'B'::text) AND ((mcp.cs_estatus)::text = ANY (ARRAY[('I'::character varying)::text, ('C'::character varying)::text])))
        UNION ALL
         SELECT tabactconproductos.apartado,
            ( SELECT max(mcap.id_proyecto) AS max
                   FROM public.met_cortoplazo_actividad mcap
                  WHERE (mcap.id_actividad = tabactconproductos.idllave)) AS id_proyecto,
            tabactconproductos.idllave,
                CASE
                    WHEN (tabactconproductos.contapresupuesto = 0) THEN 'I'::text
                    ELSE 'C'::text
                END AS csestatusactividad
           FROM ( SELECT 'Producto'::text AS apartado,
                    mprod.id_producto,
                    mprod.id_actividad AS idllave,
                    mprod.cs_estatus AS cs_estatusact,
                    ( SELECT count(mcpre.id_presupuesto) AS count
                           FROM public.met_cortoplazo_presupuesto mcpre
                          WHERE ((mprod.id_producto = mcpre.id_producto) AND ((mcpre.cs_estatus)::text <> 'B'::text))) AS contapresupuesto,
                    'I'::text AS cs_estatuspro
                   FROM public.met_cortoplazo_producto mprod
                  WHERE ((mprod.cs_estatus)::text = 'C'::text)) tabactconproductos
        UNION ALL
         SELECT 'Presupuesto'::text AS apartado,
            ( SELECT DISTINCT mcap2.id_proyecto
                   FROM ((public.met_cortoplazo_actividad mcap2
                     JOIN public.met_cortoplazo_producto mcp2 ON ((mcap2.id_actividad = mcp2.id_actividad)))
                     JOIN public.met_cortoplazo_presupuesto pre2 ON ((pre2.id_producto = mcp2.id_producto)))
                  WHERE (pre2.id_presupuesto = mcpr.id_presupuesto)) AS id_proyecto,
            mcpr.id_presupuesto AS idllave,
            mcpr.cs_estatus
           FROM public.met_cortoplazo_presupuesto mcpr
          WHERE ((mcpr.id_producto IN ( SELECT mcpro.id_producto
                   FROM public.met_cortoplazo_producto mcpro
                  WHERE (mcpro.id_actividad IN ( SELECT mca.id_actividad
                           FROM public.met_cortoplazo_actividad mca
                          WHERE (((mca.cs_estatus)::text <> 'B'::text) AND ((mca.cs_estatus)::text = ANY (ARRAY[('I'::character varying)::text, ('C'::character varying)::text]))))))) AND ((mcpr.cs_estatus)::text <> 'B'::text))) apartadoinfo ON ((apartadotempo.apartado = apartadoinfo.apartado)))
  GROUP BY apartadoinfo.apartado, apartadoinfo.id_proyecto, apartadoinfo.cs_estatus;


