    mcp.id_catalogo_tipo_producto,
    mcp.id_catalogo_indicador,
    mcp.id_catalogo_nivel_educativo,
    mcp.cx_cvenombre_potic,
    mcp.lock_flag,
    mcp.id_catalogo_categorizacion,
    mcp.id_catalogo_continuidad,
    mcp.id_catalogo_indicador_pl,
    mcp.id_catalogo_anhio_pub,
    mcp.id_validacion,
    mcp.id_validacion_planeacion,
    mcp.id_validacion_supervisor,
    mcp.id_justificacion_mir,
    mcp.id_justificacion_pi,
    mcp.id_indicador_pi
   FROM ((public.vt_cp_proyecto vcp
     JOIN public.met_cortoplazo_actividad mca ON ((vcp.id_proyecto = mca.id_proyecto)))
     JOIN public.met_cortoplazo_producto mcp ON ((mca.id_actividad = mcp.id_actividad)))
  WHERE (((vcp.cs_estatus)::text = 'O'::text) AND ((mca.cs_estatus)::text = 'C'::text) AND ((mcp.cs_estatus)::text = 'C'::text) AND (NOT (mcp.id_producto IN ( SELECT map2.id_producto_modificacion
           FROM public.met_adecuacion_producto map2
          WHERE (map2.id_producto_modificacion IS NOT NULL)))));


ALTER VIEW public.vt_producto OWNER TO postgres;

