--

CREATE VIEW public.vt_productoactivoentregable AS
 SELECT cpp.id_producto,
    sum(pcal.ci_monto) AS entregables,
    sum(pcal.ci_entregados) AS avanzados
   FROM (public.met_cortoplazo_producto cpp
     JOIN public.met_producto_calendario pcal ON ((cpp.id_producto = pcal.id_producto)))
  WHERE ((cpp.cs_estatus)::text <> 'B'::text)
  GROUP BY cpp.id_producto;


ALTER VIEW public.vt_productoactivoentregable OWNER TO postgres;

--
-- Name: vt_producto_avance; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_producto_avance AS
 SELECT p.id_anhio,
    p.id_catalogo_unidad,
    p.id_proyecto,
    p.id_actividad,
    p.id_producto,
    p.cs_estatus,
    sum(pe.entregables) AS planeados,
    sum(pe.avanzados) AS avanzados,
    (sum(pe.avanzados) = (0)::numeric) AS nocumplido,
    ((sum(pe.avanzados) > (0)::numeric) AND (sum(pe.avanzados) < sum(pe.entregables))) AS parcialcumplido,
    ((sum(pe.avanzados) = sum(pe.entregables)) AND (sum(pe.avanzados) > (0)::numeric)) AS cumplido,
    (sum(pe.avanzados) > sum(pe.entregables)) AS superado
   FROM (public.vt_producto p
     JOIN public.vt_productoactivoentregable pe ON ((p.id_producto = pe.id_producto)))
  GROUP BY p.id_anhio, p.id_catalogo_unidad, p.id_proyecto, p.id_actividad, p.id_producto, p.cs_estatus;


ALTER VIEW public.vt_producto_avance OWNER TO postgres;

--
-- Name: vt_producto_avance_trimestre; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_producto_avance_trimestre AS
 SELECT row_number() OVER (ORDER BY id_anhio DESC) AS idavancetri,
    id_anhio,
    id_catalogo_unidad,
    id_proyecto,
    id_actividad,
    id_producto,
    ixtrimestre,
    ci_mes,
    id_prodcal,
    sum(avanzadostri) AS avanzadostri,
    sum(entregablestri) AS entregablestri,
    (sum(avanzadostri) = 0) AS nocumplido,
    ((sum(avanzadostri) > 0) AND (sum(avanzadostri) < sum(entregablestri))) AS parcialcumplido,
    ((sum(avanzadostri) = sum(entregablestri)) AND (sum(avanzadostri) > 0)) AS cumplido,
    (sum(avanzadostri) > sum(entregablestri)) AS superado
   FROM ( SELECT pa1_0.id_producto,
            pa1_0.planeados,
            pa1_0.avanzados,
            pa1_0.cs_estatus,
            pa1_0.cumplido,
            pa1_0.id_actividad,
            pa1_0.id_anhio,
            pa1_0.id_catalogo_unidad,
            pa1_0.id_proyecto,
            pa1_0.nocumplido,
            pa1_0.parcialcumplido,
            pa1_0.superado,
            mpc.id_prodcal,
            (1 + (mpc.ci_mes / 4)) AS ixtrimestre,
            mpc.ci_mes,
            mpc.ci_monto AS entregablestri,
            mpc.ci_entregados AS avanzadostri
           FROM (public.vt_producto_avance pa1_0
             JOIN public.met_producto_calendario mpc ON (((mpc.id_producto = pa1_0.id_producto) AND (mpc.ci_monto > 0))))) t
  GROUP BY id_anhio, id_catalogo_unidad, id_actividad, id_proyecto, id_producto, ixtrimestre, ci_mes, id_prodcal
  ORDER BY id_anhio, id_catalogo_unidad;


ALTER VIEW public.vt_producto_avance_trimestre OWNER TO postgres;

--
-- Name: vt_avance_producto_anhio_unidad; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_avance_producto_anhio_unidad AS
 SELECT row_number() OVER (ORDER BY id_anhio DESC) AS id_avance,
    id_anhio,
    id_catalogo_unidad,
    cumplido,
    nocumplido,
    parcialcumplido,
    superado
   FROM ( SELECT DISTINCT vp.id_anhio,
            vp.id_catalogo_unidad,
            tcumple.cumplido,
            tnocumple.nocumplido,
            tparcial.parcialcumplido,
            tsuperado.superado
           FROM ((((public.vt_producto vp
             LEFT JOIN ( SELECT t.id_anhio,
                    t.id_catalogo_unidad,
                    count(*) AS cumplido
                   FROM ( SELECT vt_producto_avance_trimestre.id_anhio,
                            vt_producto_avance_trimestre.id_catalogo_unidad,
                            vt_producto_avance_trimestre.id_producto
                           FROM public.vt_producto_avance_trimestre
                          WHERE (vt_producto_avance_trimestre.cumplido IS TRUE)
                          GROUP BY vt_producto_avance_trimestre.id_anhio, vt_producto_avance_trimestre.id_catalogo_unidad, vt_producto_avance_trimestre.id_producto) t
                  GROUP BY t.id_anhio, t.id_catalogo_unidad) tcumple ON (((vp.id_anhio = tcumple.id_anhio) AND (tcumple.id_catalogo_unidad = vp.id_catalogo_unidad))))
             LEFT JOIN ( SELECT t.id_anhio,
                    t.id_catalogo_unidad,
                    count(*) AS nocumplido
                   FROM ( SELECT vt_producto_avance_trimestre.id_anhio,
                            vt_producto_avance_trimestre.id_catalogo_unidad,
                            vt_producto_avance_trimestre.id_producto
                           FROM public.vt_producto_avance_trimestre
                          WHERE (vt_producto_avance_trimestre.nocumplido IS TRUE)
                          GROUP BY vt_producto_avance_trimestre.id_anhio, vt_producto_avance_trimestre.id_catalogo_unidad, vt_producto_avance_trimestre.id_producto) t
                  GROUP BY t.id_anhio, t.id_catalogo_unidad) tnocumple ON (((vp.id_anhio = tnocumple.id_anhio) AND (tnocumple.id_catalogo_unidad = vp.id_catalogo_unidad))))
             LEFT JOIN ( SELECT t.id_anhio,
                    t.id_catalogo_unidad,
                    count(*) AS parcialcumplido
                   FROM ( SELECT vt_producto_avance_trimestre.id_anhio,
                            vt_producto_avance_trimestre.id_catalogo_unidad,
                            vt_producto_avance_trimestre.id_producto
                           FROM public.vt_producto_avance_trimestre
                          WHERE (vt_producto_avance_trimestre.parcialcumplido IS TRUE)
                          GROUP BY vt_producto_avance_trimestre.id_anhio, vt_producto_avance_trimestre.id_catalogo_unidad, vt_producto_avance_trimestre.id_producto) t
                  GROUP BY t.id_anhio, t.id_catalogo_unidad) tparcial ON (((vp.id_anhio = tparcial.id_anhio) AND (tparcial.id_catalogo_unidad = vp.id_catalogo_unidad))))
             LEFT JOIN ( SELECT t.id_anhio,
                    t.id_catalogo_unidad,
                    count(*) AS superado
                   FROM ( SELECT vt_producto_avance_trimestre.id_anhio,
                            vt_producto_avance_trimestre.id_catalogo_unidad,
                            vt_producto_avance_trimestre.id_producto
                           FROM public.vt_producto_avance_trimestre
                          WHERE (vt_producto_avance_trimestre.superado IS TRUE)
                          GROUP BY vt_producto_avance_trimestre.id_anhio, vt_producto_avance_trimestre.id_catalogo_unidad, vt_producto_avance_trimestre.id_producto) t
                  GROUP BY t.id_anhio, t.id_catalogo_unidad) tsuperado ON (((vp.id_anhio = tsuperado.id_anhio) AND (tsuperado.id_catalogo_unidad = vp.id_catalogo_unidad))))) infava;


ALTER VIEW public.vt_avance_producto_anhio_unidad OWNER TO postgres;

--
-- Name: vt_entregable_producto; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_entregable_producto AS
 SELECT vcp.id_anhio,
    concat((vcp.id_anhio - 2000), "left"((vcp.cve_unidad)::text, 1), vcp.cve_proyecto) AS cve_proyecto,
