    met_cortoplazo_proyecto.cve_proyecto,
    seg_perfil_laboral.id_catalogo_unidad,
    cat_master_catalogo.cd_opcion,
    cat_master_catalogo.cc_externa,
    cat_master_catalogo.id_catalogo_padre,
    met_cortoplazo_actividad.it_semantica
   FROM ((((public.met_estrategia_accion
     JOIN public.met_cortoplazo_actividad ON ((met_cortoplazo_actividad.id_actividad = met_estrategia_accion.id_actividad)))
     JOIN public.cat_master_catalogo ON ((cat_master_catalogo.id_catalogo = met_estrategia_accion.id_catalogo)))
     JOIN public.seg_perfil_laboral ON (((seg_perfil_laboral.cve_usuario)::text = (met_cortoplazo_actividad.cve_usuario)::text)))
     JOIN public.met_cortoplazo_proyecto ON ((met_cortoplazo_proyecto.id_proyecto = met_cortoplazo_actividad.id_proyecto)))
  WHERE ((met_estrategia_accion.ix_tipo = 2) AND ((met_cortoplazo_actividad.cs_estatus)::text = 'C'::text))
  ORDER BY cat_master_catalogo.cc_externa;


