-- Name: vt_metasBienestar; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public."vt_metasBienestar" AS
 SELECT vao.cve_usuario AS cveusuario,
    vao.id_anhio AS anhio,
    vao.id_proyecto,
    vao.id_catalogo_unidad,
    vai.id_catalogo_indicador,
    mme.id_elemento AS idmeta,
    vao.cveobjetivo,
    '.'::text AS cvemetapara,
    vai.nomindicador,
    cmc.cd_opcion AS periodicidad,
    mme.cx_periodo AS periodicidadotro,
    cmcmed.cd_opcion AS unidadmedida,
    mme.cx_unidad_medida AS unidadmedidaotro,
    cmctend.cd_opcion AS tendencia,
    'tendenciaOtro'::text AS tendenciaotro,
    'Encuesta'::text AS fuente,
    'fuenteOtro'::text AS fuenteotro,
    sum(vai.entregables) AS entregables
   FROM (((((public."vt_actividadObjetivo" vao
     JOIN public."vt_actividadIndicadorPI" vai ON ((vao.id_actividad = vai.id_actividad)))
     LEFT JOIN public.met_mp_elemento mme ON ((mme.id_catalogo_objetivo = vao.id_catalogo_objetivo)))
     LEFT JOIN public.cat_master_catalogo cmc ON ((mme.id_catalogo_periodicidad = cmc.id_catalogo)))
     LEFT JOIN public.cat_master_catalogo cmcmed ON ((mme.id_catalogo_unidad_medida = cmcmed.id_catalogo)))
     LEFT JOIN public.cat_master_catalogo cmctend ON ((mme.id_catalogo_tendencia = cmctend.id_catalogo)))
  GROUP BY vao.cve_usuario, vao.id_anhio, vao.id_proyecto, vao.id_catalogo_unidad, vai.id_catalogo_indicador, mme.id_elemento, vao.cveobjetivo, vai.nomindicador, cmc.cd_opcion, mme.cx_periodo, cmcmed.cd_opcion, mme.cx_unidad_medida, cmctend.cd_opcion;


