-- Name: vt_metasBienestarV2; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public."vt_metasBienestarV2" AS
 SELECT met_mp_elemento.id_elemento,
    met_mp_elemento.id_elemento AS id_indicador_pi,
    met_cortoplazo_proyecto.id_anhio,
    met_cortoplazo_proyecto.cve_usuario,
    seg_perfil_laboral.id_catalogo_unidad AS id_unidad,
    objetivo_prioritario.cc_externa AS cve_objetivo,
    rel_periodicidad.cd_opcion AS periodicidad,
    met_mp_elemento.cx_periodo AS periodicidad_otro,
    rel_unidad_medida.cd_opcion AS unidad_medida,
    met_mp_elemento.cx_unidad_medida AS unidad_medida_otro,
    rel_tendencia.cd_opcion AS tendencia,
    met_mp_elemento.cx_nombre AS indicador,
    met_producto_calendario.ci_monto AS entregables
   FROM (((((((((public.met_mp_elemento
     LEFT JOIN public.cat_master_catalogo rel_periodicidad ON ((met_mp_elemento.id_catalogo_periodicidad = rel_periodicidad.id_catalogo)))
     LEFT JOIN public.cat_master_catalogo rel_unidad_medida ON ((met_mp_elemento.id_catalogo_unidad_medida = rel_unidad_medida.id_catalogo)))
     LEFT JOIN public.cat_master_catalogo rel_tendencia ON ((met_mp_elemento.id_catalogo_tendencia = rel_tendencia.id_catalogo)))
     JOIN public.cat_master_catalogo objetivo_prioritario ON ((objetivo_prioritario.id_catalogo = met_mp_elemento.id_catalogo_objetivo)))
     JOIN public.met_cortoplazo_producto ON ((met_cortoplazo_producto.id_indicador_pi = met_mp_elemento.id_elemento)))
     JOIN public.met_cortoplazo_actividad ON ((met_cortoplazo_actividad.id_actividad = met_cortoplazo_producto.id_actividad)))
     JOIN public.met_cortoplazo_proyecto ON ((met_cortoplazo_proyecto.id_proyecto = met_cortoplazo_actividad.id_proyecto)))
     LEFT JOIN public.seg_perfil_laboral ON (((seg_perfil_laboral.cve_usuario)::text = (met_cortoplazo_proyecto.cve_usuario)::text)))
     JOIN public.met_producto_calendario ON ((met_producto_calendario.id_producto = met_cortoplazo_producto.id_producto)))
  WHERE ((objetivo_prioritario.df_baja IS NULL) AND ((met_cortoplazo_proyecto.cs_estatus)::text <> 'B'::text) AND ((met_cortoplazo_actividad.cs_estatus)::text <> 'B'::text) AND ((met_cortoplazo_producto.cs_estatus)::text <> 'B'::text));


