--
-- Name: vt_paa_aprobado; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_paa_aprobado AS
 SELECT row_number() OVER (ORDER BY cp.id_anhio DESC) AS id,
    cp.id_anhio,
    'PAA_Aprobado'::text AS origen,
    cp.cve_unidad,
    concat("right"((cp.id_anhio)::text, 2), "left"((cp.cve_unidad)::text, 1), cp.cve_proyecto) AS cve_proyecto,
    cp.cx_nombre_proyecto,
    concat("right"((cp.id_anhio)::text, 2), '1', cp.cve_proyecto, '-', ca.cve_actividad) AS cve_actividad,
    cp.cs_estatus,
    ca.cx_nombre_actividad,
    concat("right"((cp.id_anhio)::text, 2), '1', cp.cve_proyecto, '-', ca.cve_actividad, '-', cpro.cve_producto, '-', '0', mccatego.cc_externa, '-', mctipo.cc_externa) AS cve_producto,
    cpro.cx_nombre,
    cpro.id_catalogo_indicador,
    mcmir.cd_opcion AS cd_indicadormir,
    mcmir.cc_externa,
    mcmir.cc_externados,
    cpro.id_catalogo_indicador_pl,
    mcpi.cd_opcion AS cd_indicadorpi,
    mccatego.cd_opcion AS categoria,
    mctipo.cd_opcion AS tipo,
    mcalprod.ci_mes AS mes,
    mcalprod.ci_monto AS entregable,
    ( SELECT sum(mparc.ix_monto) AS sum
           FROM public.met_presupuesto_calendario mparc,
            public.met_cortoplazo_presupuesto mcpres,
            public.met_partida_gasto mpg
          WHERE (((mcpres.cs_estatus)::text = 'C'::text) AND (mcpres.id_producto = mcalprod.id_producto) AND (mpg.id_presupuesto = mcpres.id_presupuesto) AND (mpg.id_partida = mparc.id_partida) AND (mparc.ix_mes = mcalprod.ci_mes))) AS calendarizaciongastoxmes,
    0 AS entragablescalendarizado,
    0 AS montocalendarizado
   FROM ((((((((public.met_cortoplazo_proyecto cp
     JOIN public.met_validacion mv ON ((cp.id_validacion_supervisor = mv.id_validacion)))
     JOIN public.met_cortoplazo_actividad ca ON (((cp.id_proyecto = ca.id_proyecto) AND (ca.it_semantica = 1))))
     JOIN public.met_cortoplazo_producto cpro ON (((ca.id_actividad = cpro.id_actividad) AND (cpro.it_semantica = 1))))
     LEFT JOIN public.cat_master_catalogo mccatego ON ((cpro.id_catalogo_categorizacion = mccatego.id_catalogo)))
     LEFT JOIN public.cat_master_catalogo mctipo ON ((cpro.id_catalogo_tipo_producto = mctipo.id_catalogo)))
     LEFT JOIN public.cat_master_catalogo mcmir ON ((cpro.id_catalogo_indicador = mcmir.id_catalogo)))
     LEFT JOIN public.cat_master_catalogo mcpi ON ((cpro.id_catalogo_indicador_pl = mcpi.id_catalogo)))
     JOIN public.met_producto_calendario mcalprod ON ((mcalprod.id_producto = cpro.id_producto)))
  WHERE ((cp.it_semantica = 1) AND ((cp.cs_estatus)::text = 'O'::text) AND ((mv.cs_estatus)::text = 'O'::text) AND ((ca.cs_estatus)::text = 'C'::text) AND ((cpro.cs_estatus)::text = 'C'::text) AND (mcalprod.ci_monto > 0));


ALTER VIEW public.vt_paa_aprobado OWNER TO postgres;

