--
-- Name: vt_presupuesto_proyecto_unidad; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_presupuesto_proyecto_unidad AS
 SELECT cpro.id_anhio,
    cpro.id_catalogo_unidad,
    cpro.cve_unidad,
    cpro.id_proyecto,
    concat("right"((cpro.id_anhio)::text, 2), "left"((cpro.cve_unidad)::text, 1), cpro.cve_proyecto) AS cveproyecto,
    cpro.cx_nombre_proyecto,
    sum(pg.ix_anual) AS totalanualasignado,
    COALESCE(vppp.ixanual, (0)::double precision) AS totalcalendarizado
   FROM (((((public.met_partida_gasto pg
     JOIN public.met_cortoplazo_presupuesto cpre ON ((cpre.id_presupuesto = pg.id_presupuesto)))
     JOIN public.met_cortoplazo_producto cprod ON ((cpre.id_producto = cprod.id_producto)))
     JOIN public.met_cortoplazo_actividad cact ON ((cprod.id_actividad = cact.id_actividad)))
     JOIN public.met_cortoplazo_proyecto cpro ON ((cpro.id_proyecto = cact.id_proyecto)))
     LEFT JOIN public.vt_presupuesto_programado_proyecto vppp ON ((cpro.id_proyecto = vppp.id_proyecto)))
  WHERE (((cpro.cs_estatus)::text = 'O'::text) AND ((cact.cs_estatus)::text = 'C'::text) AND ((cprod.cs_estatus)::text = 'C'::text) AND ((cpre.cs_estatus)::text = 'C'::text))
  GROUP BY cpro.id_anhio, cpro.id_catalogo_unidad, cpro.id_proyecto, cpro.cve_proyecto, cpro.cve_unidad, cpro.cx_nombre_proyecto, vppp.ixanual;


ALTER VIEW public.vt_presupuesto_proyecto_unidad OWNER TO postgres;

--
-- Name: vt_proyecto_apartado_estatus; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_proyecto_apartado_estatus AS
 SELECT row_number() OVER (ORDER BY id_proyecto DESC) AS id_secuencia,
    id_proyecto,
    id,
    apartado,
    id_validacion_supervisor,
    cs_estatus
   FROM ( SELECT cp.id_proyecto,
            '1 proyecto'::text AS apartado,
            cp.id_proyecto AS id,
            cp.id_validacion_supervisor,
            mv.cs_estatus
           FROM (public.met_cortoplazo_proyecto cp
             LEFT JOIN public.met_validacion mv ON ((mv.id_validacion = cp.id_validacion_supervisor)))
          WHERE ((cp.cs_estatus)::text <> 'B'::text)
        UNION
         SELECT cp.id_proyecto,
            '2 actividades'::text AS apartado,
            ca.id_actividad AS id,
            ca.id_validacion_supervisor,
            mv.cs_estatus
           FROM ((public.met_cortoplazo_proyecto cp
             JOIN public.met_cortoplazo_actividad ca ON ((cp.id_proyecto = ca.id_proyecto)))
             LEFT JOIN public.met_validacion mv ON ((mv.id_validacion = ca.id_validacion_supervisor)))
          WHERE (((cp.cs_estatus)::text <> 'B'::text) AND ((ca.cs_estatus)::text <> 'B'::text))
        UNION
         SELECT cp.id_proyecto,
            '3 productos'::text AS apartado,
            cpro.id_producto AS id,
            cpro.id_validacion_supervisor,
            mv.cs_estatus
           FROM (((public.met_cortoplazo_proyecto cp
             JOIN public.met_cortoplazo_actividad ca ON ((cp.id_proyecto = ca.id_proyecto)))
             JOIN public.met_cortoplazo_producto cpro ON ((ca.id_actividad = cpro.id_actividad)))
             LEFT JOIN public.met_validacion mv ON ((mv.id_validacion = cpro.id_validacion_supervisor)))
          WHERE (((cp.cs_estatus)::text <> 'B'::text) AND ((ca.cs_estatus)::text <> 'B'::text) AND ((cpro.cs_estatus)::text <> 'B'::text))
        UNION
         SELECT cp.id_proyecto,
            '4 presupuesto'::text AS apartado,
            cpre.id_presupuesto AS id,
            cpre.id_validacion_supervisor,
            mv.cs_estatus
           FROM ((((public.met_cortoplazo_proyecto cp
             JOIN public.met_cortoplazo_actividad ca ON ((cp.id_proyecto = ca.id_proyecto)))
             JOIN public.met_cortoplazo_producto cpro ON ((ca.id_actividad = cpro.id_actividad)))
             JOIN public.met_cortoplazo_presupuesto cpre ON ((cpre.id_producto = cpro.id_producto)))
             LEFT JOIN public.met_validacion mv ON ((mv.id_validacion = cpre.id_validacion_supervisor)))
          WHERE (((cp.cs_estatus)::text <> 'B'::text) AND ((ca.cs_estatus)::text <> 'B'::text) AND ((cpro.cs_estatus)::text <> 'B'::text) AND ((cpre.cs_estatus)::text <> 'B'::text))) tcpv;


ALTER VIEW public.vt_proyecto_apartado_estatus OWNER TO postgres;

--
-- Name: vt_presupuesto_unidad; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_presupuesto_unidad AS
 SELECT vpro.id_anhio,
    vpro.id_catalogo_unidad,
    vpro.cve_unidad,
    sum(pg.ix_anual) AS totalanualasignado,
    sum(pc.ix_monto) AS totalcalendarizado,
    mc.cc_externados
   FROM ((((public.met_presupuesto_calendario pc
     JOIN public.met_partida_gasto pg ON ((pg.id_partida = pc.id_partida)))
     JOIN public.vt_proyecto_apartado_estatus pae ON ((pae.id = pg.id_presupuesto)))
     JOIN public.vt_cp_proyecto vpro ON ((pae.id_proyecto = vpro.id_proyecto)))
     LEFT JOIN public.cat_master_catalogo mc ON ((vpro.id_catalogo_unidad = mc.id_catalogo)))
  WHERE ((pae.apartado = '4 presupuesto'::text) AND ((vpro.cs_estatus)::text = 'O'::text))
  GROUP BY vpro.id_anhio, vpro.id_catalogo_unidad, vpro.cve_unidad, mc.cc_externados;


ALTER VIEW public.vt_presupuesto_unidad OWNER TO postgres;

--
-- Name: vt_producto_categoria; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_producto_categoria AS
 SELECT row_number() OVER (ORDER BY id_anhio DESC) AS id,
    id_anhio,
    cve_proyecto,
    id_catalogo_unidad,
    id_catalogo_categorizacion,
    count(*) AS cx_totalproducto
   FROM ( SELECT vt_entregable_producto.id_anhio,
            vt_entregable_producto.cve_proyecto,
            vt_entregable_producto.id_catalogo_unidad,
            vt_entregable_producto.id_catalogo_categorizacion,
