    indicador.cc_externa,
    indicador.cc_externados,
    met_cortoplazo_producto.cve_producto,
    met_cortoplazo_actividad.cve_actividad,
    met_cortoplazo_proyecto.cve_proyecto,
    categorizacion.cc_externa AS categorizacion,
