    met_cortoplazo_producto.cx_nombre,
    met_cortoplazo_proyecto.id_anhio,
    seg_perfil_laboral.id_catalogo_unidad,
    unidad.cc_externa AS cve_unidad
   FROM (((((((((public.met_cortoplazo_producto
     JOIN public.met_cortoplazo_actividad ON ((met_cortoplazo_producto.id_actividad = met_cortoplazo_actividad.id_actividad)))
     JOIN public.met_cortoplazo_proyecto ON ((met_cortoplazo_actividad.id_proyecto = met_cortoplazo_proyecto.id_proyecto)))
     JOIN public.seg_usuario ON (((met_cortoplazo_proyecto.cve_usuario)::text = (seg_usuario.cve_usuario)::text)))
     JOIN public.seg_perfil_laboral ON (((seg_usuario.cve_usuario)::text = (seg_perfil_laboral.cve_usuario)::text)))
     JOIN public.cat_master_catalogo indicador ON ((indicador.id_catalogo = met_cortoplazo_producto.id_catalogo_indicador)))
     JOIN public.met_indicador_resultado ON ((met_indicador_resultado.id_catalogo = indicador.id_catalogo)))
     JOIN public.cat_master_catalogo categorizacion ON ((categorizacion.id_catalogo = met_cortoplazo_producto.id_catalogo_categorizacion)))
     JOIN public.cat_master_catalogo tipo_producto ON ((tipo_producto.id_catalogo = met_cortoplazo_producto.id_catalogo_tipo_producto)))
     JOIN public.cat_master_catalogo unidad ON ((unidad.id_catalogo = seg_perfil_laboral.id_catalogo_unidad)))
  WHERE (((met_cortoplazo_proyecto.cs_estatus)::text <> 'B'::text) AND ((met_cortoplazo_actividad.cs_estatus)::text <> 'B'::text) AND ((met_cortoplazo_producto.cs_estatus)::text <> 'B'::text));


