             LEFT JOIN public.met_validacion mv ON ((mv.id_validacion = cpre.id_validacion)))
          WHERE ((cp.it_semantica = 1) AND ((cp.cs_estatus)::text <> 'B'::text) AND ((ca.cs_estatus)::text <> 'B'::text) AND ((cpro.cs_estatus)::text <> 'B'::text) AND ((cpre.cs_estatus)::text <> 'B'::text))) tcpv;


