--
-- Name: vt_reporte_seguimiento; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_reporte_seguimiento AS
 SELECT mcp.id_anhio,
    mcp.id_proyecto,
    mcp.id_catalogo_unidad,
    vps.cs_estatus,
    ( SELECT count(*) AS count
           FROM public.met_cortoplazo_actividad mca_1
          WHERE ((mca_1.id_proyecto = mcp.id_proyecto) AND ((mca_1.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text])))) AS conta_actividades,
    ( SELECT count(*) AS count
           FROM public.met_cortoplazo_producto mcpro
          WHERE ((mcpro.id_actividad IN ( SELECT mcac.id_actividad
                   FROM public.met_cortoplazo_actividad mcac
                  WHERE ((mcac.id_proyecto = mcp.id_proyecto) AND ((mcac.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text]))))) AND ((mcpro.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text])))) AS conta_productos,
    ( SELECT count(*) AS count
           FROM public.met_cortoplazo_presupuesto mcpre
          WHERE ((mcpre.id_producto IN ( SELECT mcpro.id_producto
                   FROM public.met_cortoplazo_producto mcpro
                  WHERE ((mcpro.id_actividad IN ( SELECT mcac.id_actividad
                           FROM public.met_cortoplazo_actividad mcac
                          WHERE ((mcac.id_proyecto = mcp.id_proyecto) AND ((mcac.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text]))))) AND ((mcpro.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text]))))) AND ((mcpre.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text])))) AS conta_presupuesto,
    vps.ix_trimestre,
    sum(vps.entregablesprogramados) AS entregablesprogramados,
    sum(vps.productosentregados) AS productosentregados,
    sum(vps.entregablesfinalizados) AS entregablesfinalizados
   FROM public.met_cortoplazo_proyecto mcp,
    public.met_cortoplazo_actividad mca,
    public.vt_producto_sumatiroa vps
  WHERE (((mcp.cs_estatus)::text = 'O'::text) AND (mcp.id_proyecto = mca.id_proyecto) AND (mca.id_actividad = vps.id_actividad))
  GROUP BY mcp.id_anhio, mcp.id_proyecto, mcp.id_catalogo_unidad, vps.ix_trimestre, vps.cs_estatus;


