    id_solicitud,
    id_catalogo_modificacion,
    id_catalogo_apartado,
    id_modificacion,
    id_referencia
   FROM ( SELECT 'APRO'::text AS tipo,
            s.id_solicitud,
            asol.id_catalogo_modificacion,
            asol.id_catalogo_apartado,
            mapro.id_proyecto_modificacion AS id_modificacion,
            mapro.id_proyecto_referencia AS id_referencia
           FROM ((public.met_solicitud s
             JOIN public.met_adecuacion_solicitud asol ON ((asol.id_solicitud = s.id_solicitud)))
             JOIN public.met_adecuacion_proyecto mapro ON ((asol.id_adecuacion_solicitud = mapro.id_adecuacion_solicitud)))
        UNION ALL
         SELECT 'AACT'::text AS tipo,
            s.id_solicitud,
            asol.id_catalogo_modificacion,
            asol.id_catalogo_apartado,
            maact.id_actividad_modificacion AS id_modificacion,
            maact.id_actividad_referencia AS id_referencia
           FROM ((public.met_solicitud s
             JOIN public.met_adecuacion_solicitud asol ON ((asol.id_solicitud = s.id_solicitud)))
             JOIN public.met_adecuacion_actividad maact ON ((asol.id_adecuacion_solicitud = maact.id_adecuacion_solicitud)))
        UNION ALL
         SELECT 'APTO'::text AS tipo,
            s.id_solicitud,
            asol.id_catalogo_modificacion,
            asol.id_catalogo_apartado,
            mapto.id_producto_modificacion AS id_modificacion,
            mapto.id_producto_referencia AS id_referencia
           FROM ((public.met_solicitud s
             JOIN public.met_adecuacion_solicitud asol ON ((asol.id_solicitud = s.id_solicitud)))
             JOIN public.met_adecuacion_producto mapto ON ((asol.id_adecuacion_solicitud = mapto.id_adecuacion_solicitud)))
        UNION ALL
         SELECT 'APRE'::text AS tipo,
            s.id_solicitud,
            asol.id_catalogo_modificacion,
            asol.id_catalogo_apartado,
            mapre.id_presupuesto_modificacion AS id_modificacion,
            mapre.id_presupuesto_referencia AS id_referencia
           FROM ((public.met_solicitud s
             JOIN public.met_adecuacion_solicitud asol ON ((asol.id_solicitud = s.id_solicitud)))
             JOIN public.met_adecuacion_presupuesto mapre ON ((asol.id_adecuacion_solicitud = mapre.id_adecuacion_solicitud)))) segadecua;


ALTER VIEW public.vt_seguimiento_adecua_registro OWNER TO postgres;

--
-- Name: vt_seguimiento_extractores; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_seguimiento_extractores AS
 SELECT met_cortoplazo_proyecto.id_proyecto,
    met_cortoplazo_proyecto.id_anhio,
    met_cortoplazo_proyecto.id_catalogo_unidad,
    met_cortoplazo_proyecto.cve_proyecto,
    met_cortoplazo_proyecto.cx_nombre_proyecto,
    met_cortoplazo_actividad.id_actividad,
    met_cortoplazo_actividad.cve_actividad,
    met_cortoplazo_actividad.cx_nombre_actividad,
    met_cortoplazo_producto.id_producto,
    met_cortoplazo_producto.cve_producto,
    met_cortoplazo_producto.cx_nombre,
    met_cortoplazo_presupuesto.id_presupuesto,
    met_cortoplazo_presupuesto.cve_accion,
    met_cortoplazo_presupuesto.cx_nombre_accion,
    met_solicitud.id_solicitud,
    met_solicitud.cve_folio_solicitud
   FROM ((((((((((public.met_cortoplazo_proyecto
     JOIN public.met_cortoplazo_actividad ON ((met_cortoplazo_proyecto.id_proyecto = met_cortoplazo_actividad.id_proyecto)))
     JOIN public.met_cortoplazo_producto ON ((met_cortoplazo_actividad.id_actividad = met_cortoplazo_producto.id_actividad)))
     JOIN public.met_cortoplazo_presupuesto ON ((met_cortoplazo_producto.id_producto = met_cortoplazo_presupuesto.id_producto)))
     LEFT JOIN public.met_adecuacion_proyecto ON ((met_cortoplazo_proyecto.id_proyecto = met_adecuacion_proyecto.id_proyecto_modificacion)))
     LEFT JOIN public.met_adecuacion_actividad ON ((met_cortoplazo_actividad.id_actividad = met_adecuacion_actividad.id_actividad_modificacion)))
     LEFT JOIN public.met_adecuacion_producto ON ((met_cortoplazo_producto.id_producto = met_adecuacion_producto.id_producto_modificacion)))
     LEFT JOIN public.met_adecuacion_accion ON ((met_cortoplazo_presupuesto.id_presupuesto = met_adecuacion_accion.id_presupuesto_modificacion)))
     LEFT JOIN public.met_adecuacion_presupuesto ON ((met_cortoplazo_presupuesto.id_presupuesto = met_adecuacion_presupuesto.id_presupuesto_modificacion)))
     JOIN public.met_adecuacion_solicitud ON (((met_adecuacion_proyecto.id_adecuacion_solicitud = met_adecuacion_solicitud.id_adecuacion_solicitud) OR (met_adecuacion_actividad.id_adecuacion_solicitud = met_adecuacion_solicitud.id_adecuacion_solicitud) OR (met_adecuacion_producto.id_adecuacion_solicitud = met_adecuacion_solicitud.id_adecuacion_solicitud) OR (met_adecuacion_accion.id_adecuacion_solicitud = met_adecuacion_solicitud.id_adecuacion_solicitud) OR (met_adecuacion_presupuesto.id_adecuacion_solicitud = met_adecuacion_solicitud.id_adecuacion_solicitud))))
     JOIN public.met_solicitud ON ((met_adecuacion_solicitud.id_solicitud = met_solicitud.id_solicitud)));


ALTER VIEW public.vt_seguimiento_extractores OWNER TO postgres;

