-- Name: vt_seguimiento_proyecto; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_seguimiento_proyecto AS
 SELECT id_proyecto,
    cve_proyecto,
    cx_nombre_proyecto,
    cx_objetivo,
    cx_objetivo_prioritario,
    cve_usuario,
    id_anhio,
    df_proyecto,
    dh_proyecto,
    cs_estatus,
    id_archivo,
    cx_nombre_unidad,
    cx_alcance,
    cx_fundamentacion,
    lock_flag,
    cve_unidad,
    ix_fuente_registro,
    df_actualizacion,
    dh_actualizacion,
    cve_usuario_actualiza,
    id_validacion,
    id_validacion_planeacion,
    id_validacion_supervisor,
    id_catalogo_unidad,
