--
-- Name: vt_tabla_mir; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vt_tabla_mir AS
 SELECT row_number() OVER (ORDER BY imir.id_catalogo_indicador DESC) AS id,
    imir.id_anhio,
    imir.id_catalogo_unidad,
    imir.id_catalogo_indicador,
    imir.cd_opcion,
    imir.cc_externa AS nivel,
    imir.cc_externados AS tipo,
    count(*) AS entregables,
    sum(COALESCE(pc.ci_mes, 0)) AS totentregables
   FROM (public.vt_indicadores_mir imir
     JOIN public.met_producto_calendario pc ON ((imir.id_producto = pc.id_producto)))
  WHERE (pc.ci_monto > 0)
  GROUP BY imir.id_anhio, imir.id_catalogo_unidad, imir.id_catalogo_indicador, imir.cd_opcion, imir.cc_externa, imir.cc_externados;


ALTER VIEW public.vt_tabla_mir OWNER TO postgres;

