--
-- Name: vt_entregables_mir _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.vt_entregables_mir AS
 SELECT met_indicador_resultado.id_indicador_resultado,
    met_indicador_resultado.cx_nivel,
    met_indicador_resultado.cx_nombre,
    COALESCE(rel_unidad.id_catalogo, 0) AS id_catalogo,
    met_cortoplazo_proyecto.id_anhio,
    rel_unidad.cd_opcion,
    met_producto_calendario.ci_mes,
    sum(met_producto_calendario.ci_monto) AS ci_programado,
    sum(met_producto_calendario.ci_entregados) AS ci_entregado
   FROM ((((((public.met_indicador_resultado
     JOIN public.cat_master_catalogo ON ((cat_master_catalogo.id_catalogo = met_indicador_resultado.id_catalogo)))
     JOIN public.met_cortoplazo_producto ON ((met_cortoplazo_producto.id_catalogo_indicador = met_indicador_resultado.id_catalogo)))
     JOIN public.met_producto_calendario ON ((met_producto_calendario.id_producto = met_cortoplazo_producto.id_producto)))
     JOIN public.met_cortoplazo_actividad ON ((met_cortoplazo_actividad.id_actividad = met_cortoplazo_producto.id_actividad)))
     JOIN public.met_cortoplazo_proyecto ON ((met_cortoplazo_proyecto.id_proyecto = met_cortoplazo_proyecto.id_proyecto)))
     LEFT JOIN public.cat_master_catalogo rel_unidad ON ((rel_unidad.id_catalogo = met_cortoplazo_proyecto.id_catalogo_unidad)))
  GROUP BY met_indicador_resultado.id_indicador_resultado, rel_unidad.id_catalogo, met_cortoplazo_proyecto.id_anhio, met_producto_calendario.ci_mes;


--
-- Name: vt_presupuesto_programado_proyecto _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.vt_presupuesto_programado_proyecto AS
 SELECT cpro.id_proyecto,
    concat("right"((cpro.id_anhio)::text, 2), "left"((cpro.cve_unidad)::text, 1), cpro.cve_proyecto) AS cveproyecto,
    cpro.cx_nombre_proyecto,
    sum(mpc.ix_monto) AS ixanual
   FROM (((((public.met_presupuesto_calendario mpc
     JOIN public.met_partida_gasto pg ON ((mpc.id_partida = pg.id_partida)))
     JOIN public.met_cortoplazo_presupuesto cpre ON ((cpre.id_presupuesto = pg.id_presupuesto)))
     JOIN public.met_cortoplazo_producto cprod ON ((cpre.id_producto = cprod.id_producto)))
     JOIN public.met_cortoplazo_actividad cact ON ((cprod.id_actividad = cact.id_actividad)))
     JOIN public.met_cortoplazo_proyecto cpro ON ((cpro.id_proyecto = cact.id_proyecto)))
  WHERE (((cpro.cs_estatus)::text = 'O'::text) AND ((cact.cs_estatus)::text = 'C'::text) AND ((cprod.cs_estatus)::text = 'C'::text) AND ((cpre.cs_estatus)::text = 'C'::text))
  GROUP BY cpro.id_proyecto, cpro.cve_proyecto, cpro.cve_unidad, cpro.cx_nombre_proyecto;


--
-- Name: vt_producto_sumatiroa _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.vt_producto_sumatiroa AS
 SELECT met_cortoplazo_producto.id_producto,
    met_cortoplazo_producto.id_actividad,
    met_cortoplazo_producto.cs_estatus,
    met_mes.ix_trimestre,
        CASE
            WHEN (sum(producto_entregables.entregablesfinalizados) >= sum(producto_entregables.entregablesprogramados)) THEN 1
            ELSE 0
        END AS productosentregados,
    sum(producto_entregables.entregablesprogramados) AS entregablesprogramados,
    sum(producto_entregables.entregablesfinalizados) AS entregablesfinalizados,
    sum(producto_presupuesto.presupuesto) AS presupuesto,
        CASE
            WHEN (sum(producto_entregables.entregablesfinalizados) >= sum(producto_entregables.entregablesprogramados)) THEN sum(producto_presupuesto.presupuesto)
            ELSE (0)::double precision
        END AS presupuestoutilizado,
    sum(producto_presupuesto.adecuaciones_acciones) AS adecuaciones_acciones,
    sum(producto_presupuesto.adecuaciones_presupuesto) AS adecuaciones_presupuesto
   FROM (((public.met_cortoplazo_producto
     JOIN public.met_mes ON (true))
     LEFT JOIN ( SELECT met_cortoplazo_presupuesto.id_producto,
            met_presupuesto_calendario.ix_mes,
            sum(met_presupuesto_calendario.ix_monto) AS presupuesto,
            count(DISTINCT adecuacion_accion.id_adecuacion_accion) AS adecuaciones_acciones,
            count(DISTINCT adecuacion_presupuesto.id_adecuacion_presupuesto) AS adecuaciones_presupuesto
           FROM ((((((public.met_cortoplazo_presupuesto
             LEFT JOIN public.met_partida_gasto ON ((met_cortoplazo_presupuesto.id_presupuesto = met_partida_gasto.id_presupuesto)))
             LEFT JOIN public.met_presupuesto_calendario ON ((met_partida_gasto.id_partida = met_presupuesto_calendario.id_partida)))
             LEFT JOIN public.met_adecuacion_accion ON ((met_cortoplazo_presupuesto.id_presupuesto = met_adecuacion_accion.id_presupuesto_modificacion)))
             LEFT JOIN public.met_adecuacion_accion adecuacion_accion ON ((met_cortoplazo_presupuesto.id_presupuesto = adecuacion_accion.id_presupuesto_referencia)))
             LEFT JOIN public.met_adecuacion_presupuesto ON ((met_cortoplazo_presupuesto.id_presupuesto = met_adecuacion_presupuesto.id_presupuesto_modificacion)))
             LEFT JOIN public.met_adecuacion_presupuesto adecuacion_presupuesto ON ((met_cortoplazo_presupuesto.id_presupuesto = adecuacion_presupuesto.id_presupuesto_referencia)))
          WHERE ((met_adecuacion_accion.id_adecuacion_accion IS NULL) AND (met_adecuacion_presupuesto.id_adecuacion_presupuesto IS NULL))
          GROUP BY met_cortoplazo_presupuesto.id_producto, met_presupuesto_calendario.ix_mes) producto_presupuesto ON (((met_cortoplazo_producto.id_producto = producto_presupuesto.id_producto) AND (producto_presupuesto.ix_mes = met_mes.ix_mes))))
     LEFT JOIN ( SELECT met_producto_calendario.id_producto,
            met_producto_calendario.ci_mes,
            sum(met_producto_calendario.ci_monto) AS entregablesprogramados,
            sum(met_producto_calendario.ci_entregados) AS entregablesfinalizados
           FROM public.met_producto_calendario
          GROUP BY met_producto_calendario.id_producto, met_producto_calendario.ci_mes) producto_entregables ON (((met_cortoplazo_producto.id_producto = producto_entregables.id_producto) AND (producto_entregables.ci_mes = met_mes.ix_mes))))
  GROUP BY met_cortoplazo_producto.id_producto, met_cortoplazo_producto.cs_estatus, met_mes.ix_trimestre
  ORDER BY met_cortoplazo_producto.id_producto;


--
-- Name: vt_producto_trimestre _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.vt_producto_trimestre AS
 SELECT met_cortoplazo_producto.id_producto,
    met_cortoplazo_producto.id_actividad,
    met_cortoplazo_producto.cs_estatus,
    met_mes.ix_trimestre,
        CASE
            WHEN (sum(producto_entregables.entregablesfinalizados) >= sum(producto_entregables.entregablesprogramados)) THEN 1
            ELSE 0
        END AS productosentregados,
    sum(producto_entregables.entregablesprogramados) AS entregablesprogramados,
    sum(producto_entregables.entregablesfinalizados) AS entregablesfinalizados,
    sum(producto_presupuesto.presupuesto) AS presupuesto,
        CASE
            WHEN (sum(producto_entregables.entregablesfinalizados) >= sum(producto_entregables.entregablesprogramados)) THEN sum(producto_presupuesto.presupuesto)
            ELSE (0)::double precision
        END AS presupuestoutilizado,
    sum(producto_presupuesto.adecuaciones_acciones) AS adecuaciones_acciones,
    sum(producto_presupuesto.adecuaciones_presupuesto) AS adecuaciones_presupuesto
   FROM (((public.met_cortoplazo_producto
     JOIN public.met_mes ON (true))
     LEFT JOIN ( SELECT met_cortoplazo_presupuesto.id_producto,
            met_presupuesto_calendario.ix_mes,
            sum(met_presupuesto_calendario.ix_monto) AS presupuesto,
            count(DISTINCT adecuacion_accion.id_adecuacion_accion) AS adecuaciones_acciones,
            count(DISTINCT adecuacion_presupuesto.id_adecuacion_presupuesto) AS adecuaciones_presupuesto
           FROM ((((((((public.met_cortoplazo_presupuesto
             LEFT JOIN public.met_partida_gasto ON ((met_cortoplazo_presupuesto.id_presupuesto = met_partida_gasto.id_presupuesto)))
             LEFT JOIN public.met_presupuesto_calendario ON ((met_partida_gasto.id_partida = met_presupuesto_calendario.id_partida)))
             LEFT JOIN public.met_adecuacion_accion ON ((met_cortoplazo_presupuesto.id_presupuesto = met_adecuacion_accion.id_presupuesto_modificacion)))
             LEFT JOIN public.met_adecuacion_accion adecuacion_accion ON ((met_cortoplazo_presupuesto.id_presupuesto = adecuacion_accion.id_presupuesto_referencia)))
             LEFT JOIN public.met_adecuacion_presupuesto ON ((met_cortoplazo_presupuesto.id_presupuesto = met_adecuacion_presupuesto.id_presupuesto_modificacion)))
             LEFT JOIN public.met_adecuacion_presupuesto adecuacion_presupuesto ON ((met_cortoplazo_presupuesto.id_presupuesto = adecuacion_presupuesto.id_presupuesto_referencia)))
             LEFT JOIN ( SELECT met_adecuacion_presupuesto_1.id_adecuacion_presupuesto,
                    met_adecuacion_presupuesto_1.id_presupuesto_modificacion,
                    met_solicitud.id_catalogo_estatus
                   FROM ((public.met_adecuacion_presupuesto met_adecuacion_presupuesto_1
                     LEFT JOIN public.met_adecuacion_solicitud ON ((met_adecuacion_solicitud.id_adecuacion_solicitud = met_adecuacion_presupuesto_1.id_adecuacion_solicitud)))
                     LEFT JOIN public.met_solicitud ON ((met_solicitud.id_solicitud = met_adecuacion_solicitud.id_solicitud)))) presupuesto_modificacion ON (((presupuesto_modificacion.id_presupuesto_modificacion = met_cortoplazo_presupuesto.id_presupuesto) AND (presupuesto_modificacion.id_catalogo_estatus <> 2240))))
             LEFT JOIN ( SELECT met_adecuacion_presupuesto_1.id_adecuacion_presupuesto,
                    met_adecuacion_presupuesto_1.id_presupuesto_referencia,
                    met_solicitud.id_catalogo_estatus
                   FROM ((public.met_adecuacion_presupuesto met_adecuacion_presupuesto_1
                     LEFT JOIN public.met_adecuacion_solicitud ON ((met_adecuacion_solicitud.id_adecuacion_solicitud = met_adecuacion_presupuesto_1.id_adecuacion_solicitud)))
                     LEFT JOIN public.met_solicitud ON ((met_solicitud.id_solicitud = met_adecuacion_solicitud.id_solicitud)))) presupuesto_referencia ON (((presupuesto_referencia.id_presupuesto_referencia = met_cortoplazo_presupuesto.id_presupuesto) AND (presupuesto_referencia.id_catalogo_estatus = 2240))))
          WHERE (((met_cortoplazo_presupuesto.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text])) AND (met_adecuacion_accion.id_adecuacion_accion IS NULL) AND (presupuesto_modificacion.id_adecuacion_presupuesto IS NULL) AND (presupuesto_referencia.id_adecuacion_presupuesto IS NULL))
          GROUP BY met_cortoplazo_presupuesto.id_producto, met_presupuesto_calendario.ix_mes) producto_presupuesto ON (((met_cortoplazo_producto.id_producto = producto_presupuesto.id_producto) AND (producto_presupuesto.ix_mes = met_mes.ix_mes))))
     LEFT JOIN ( SELECT met_producto_calendario.id_producto,
            met_producto_calendario.ci_mes,
            sum(met_producto_calendario.ci_monto) AS entregablesprogramados,
            sum(met_producto_calendario.ci_entregados) AS entregablesfinalizados
           FROM public.met_producto_calendario
          GROUP BY met_producto_calendario.id_producto, met_producto_calendario.ci_mes) producto_entregables ON (((met_cortoplazo_producto.id_producto = producto_entregables.id_producto) AND (producto_entregables.ci_mes = met_mes.ix_mes))))
  WHERE ((met_cortoplazo_producto.cs_estatus)::text <> ALL (ARRAY[('I'::character varying)::text, ('B'::character varying)::text]))
  GROUP BY met_cortoplazo_producto.id_producto, met_cortoplazo_producto.cs_estatus, met_mes.ix_trimestre
  ORDER BY met_cortoplazo_producto.id_producto;


--
-- Name: vt_seguimiento_mir _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.vt_seguimiento_mir AS
 SELECT met_indicador_resultado.id_indicador_resultado,
    met_cortoplazo_proyecto.id_anhio,
    met_indicador_resultado.cx_nivel AS "nivel_MIR",
    met_indicador_resultado.cx_nombre AS indicador,
    rel_unidad.id_catalogo AS id_catalogo_unidad,
    rel_unidad.cc_externados AS unidad_corta,
    rel_unidad.cd_opcion AS unidad_larga,
    met_cortoplazo_producto.id_producto,
    met_producto_calendario.ci_mes AS mes,
    COALESCE(sum(met_producto_calendario.ci_monto), (0)::bigint) AS programado,
    COALESCE(sum(met_producto_calendario.ci_entregados), (0)::bigint) AS entregado,
    met_indicador_resultado.cx_clave
   FROM (((((public.met_indicador_resultado
     JOIN public.met_cortoplazo_producto ON ((met_cortoplazo_producto.id_catalogo_indicador = met_indicador_resultado.id_catalogo)))
     JOIN public.met_producto_calendario ON ((met_producto_calendario.id_producto = met_cortoplazo_producto.id_producto)))
     JOIN public.met_cortoplazo_actividad ON ((met_cortoplazo_actividad.id_actividad = met_cortoplazo_producto.id_actividad)))
     JOIN public.met_cortoplazo_proyecto ON ((met_cortoplazo_proyecto.id_proyecto = met_cortoplazo_actividad.id_proyecto)))
     JOIN public.cat_master_catalogo rel_unidad ON ((rel_unidad.id_catalogo = met_cortoplazo_proyecto.id_catalogo_unidad)))
  WHERE (((met_cortoplazo_proyecto.cs_estatus)::text <> 'B'::text) AND ((met_cortoplazo_actividad.cs_estatus)::text <> 'B'::text) AND ((met_cortoplazo_producto.cs_estatus)::text = 'C'::text))
  GROUP BY met_indicador_resultado.id_indicador_resultado, met_indicador_resultado.cx_nivel, met_cortoplazo_proyecto.id_anhio, met_indicador_resultado.cx_nombre, met_cortoplazo_proyecto.id_catalogo_unidad, met_cortoplazo_producto.id_producto, rel_unidad.cc_externados, rel_unidad.cd_opcion, rel_unidad.id_catalogo, met_producto_calendario.ci_mes;


