93934	Mejorar la oferta de información relevante y las orientaciones técnico-pedagógicas que contribuyan a  mejorar el aprendizaje de los estudiantes de educación básica, media superior y de adultos para fortalecer  la excelencia, la inclusión y la equidad educativa	2	2024-09-25	alejandro.lopez	592	El aprendizaje de los estudiantes es uno de los propósitos principales del SEN. Uno de los principios del SNMCE es “el aprendizaje de las niñas, niños, adolescentes y jóvenes, como centro de acción del Estado para lograr el desarrollo armónico de todas sus capacidades orientadas a fortalecer su identidad como mexicanas y mexicanos, responsables con sus semejantes y comprometidos con la transformación de la sociedad de que forman parte” (artículo 6 de la LRMCE). 	\N	2	\N	\N	\N	\N
