1038	2	Defensa jurídica y representación legal de la Comisión	Representar legalmente a la Comisión a través de la defensa de sus intereses y la atención a las controversias para solventar las situaciones que obstaculicen su operación deficiente.	\N	christian.rodriguez	2023	2024-09-03	11:00:02.171	O	1854	Unidad de Administracion y Finanzas	El Área de Administración ha programado acciones correspondientes al control y seguimiento en la representación legal de servidores públicos de la Comisión, en procedimientos contenciosos, administrativos, de investigación y arbitrales sustanciados por diversas autoridades. Lo anterior, con la finalidad de garantizar la defensa de los derechos de la Comisión y la protección de su patrimonio, de conformidad con la normatividad aplicable.\nEn este proyecto se contempla también la asistencia a servidores públicos de la Comisión para la interpretación, aplicación y elaboración de textos legales y contractuales, así como, en la ejecución de mecanismos enfocados en la protección de los derechos de carácter patrimonial de las obras, actos y documentos y de aquello que requiera la protección de los derechos de Autor. En estos servicios se incluyen las publicaciones en el Diario Oficial de la Federación de la normatividad que, en ejercicio de sus atribuciones, emita la Comisión, con el objetivo de que dicha normatividad surta efectos jurídicos.\nSon parte del PAA 2023 las actividades consistentes en la gestión y administración del uso y manejo de los servicios relacionados con Tecnologías de la información, atendiendo a los criterios de austeridad y normatividad aplicable. Asimismo, actividades de auxilio a la Secretaría Ejecutiva en ejercicio de las actividades en materia de transparencia, acceso a la información pública y protección de datos personales, para procurar que se actúe en un marco de transparencia y rendición de cuentas indispensables para llevar a cabo la gestión de proyectos que se encuentren relacionados con las actividades que la Comisión realiza.\nDentro de esta propuesta de proyecto, se ubica como actividad de impulso a la mejora de la gestión institucional, la de “Realizar acciones para la defensa y representación legal de la Comisión”.\n	Los proyectos administrativos además de orientarse hacia la operación de la Comisión buscan contribuir en el logro eficiente y eficaz de las actividades sustantivas, y abonar a las metas de mediano plazo, señaladas en el Programa Institucional (PI) 2020-2024 en el que, a través de seis objetivos prioritarios, se establecen las metas de mediano plazo para la mejora continua de le educación.\n\nEn el PAA 2023 se prevé, entre otros, el siguiente proyecto:\n\n2312 “Defensa Jurídica y Representación Legal de la Comisión”\nObjetivo. Representar legalmente a la Comisión a través de la defensa de sus intereses y la atención a las controversias para solventar las situaciones que obstaculicen su operación deficiente\nEste proyecto contribuye al objetivo 1 del PI 2020-2024 de Comisión en tanto que, el desarrollo de las actividades comprendidas en este proyecto requiere de la vinculación estrecha con las distintas áreas de la Comisión, ya que son éstas las que establecen los requerimientos y necesidades en materia de servicios jurídicos en los que el área puede incidir, así como, en las siguientes acciones puntuales del Programa Institucional (PI) 2020-2024: \n•\t1.1.1 Establecer las políticas y regulaciones para la organización y funcionamiento de la Comisión Nacional para la Mejora Continua de la Educación.\n•\t1.1.3 Determinar los mecanismos institucionales de articulación interna de los componentes y áreas administrativas de la Comisión Nacional para la Mejora Continua de la Educación.\n•\t1.3.1 Suscribir convenios de colaboración en materia de mejora continua de la educación.\n•\t1.4.4 Promover la gestión institucional conforme a la base normativa establecida.\n•\t1.5.1 Fortalecer los procesos relacionados al cumplimiento de las obligaciones de transparencia y acceso a la información pública.\n•\t1.5.2 Implementar acciones de transparencia proactiva para fortalecer la rendición de cuentas.\n	5	1210	\N	\N	\N	\N	1188	1182	1234	2371	1	\N	3	\N
