1021	5	Provisión de servicios en materia de recursos humanos, materiales y financieros	Administrar los recursos humanos, financieros, materiales y servicios, manteniendo el cometido de reducir al mínimo indispensable los suministros de bienes y la contratación de servicios, siendo estas medidas las que permitan generar ahorros en el ejercicio del gasto público, coadyuvando al cumplimiento de los objetivos y metas de las áreas administrativas de la Comisión. 	\N	pedro.isidro	2022	2024-08-29	12:36:50.531	O	1906	Unidad de Administracion y Finanzas	Se buscará impulsar la mejora de la gestión, considerando las medidas de austeridad determinadas, así como la emergencia sanitaria del COVID-19, las cuales exigen el uso adecuado de los recursos humanos, materiales, financieros y el replanteamiento de nuevas modalidades no sólo para laborar, sino para la prestación de los servicios requeridos en el trabajo a distancia.  \n\nEspecíficamente, se buscará contar con las herramientas necesarias para el aprovechamiento y aplicación eficiente de los recursos, lo cual redundará en el mejoramiento de las políticas y normas de aplicación general e incrementar la eficiencia de los procesos que se realizan en la DGAF. 	Este proyecto se orienta a dos aspectos administrativos: por un lado, a la gestión de requerimientos de personal y el desarrollo del Programa de prácticas de transformación del clima organizacional, vinculado a la profesionalización, el desarrollo humano y la igualdad de género; por otro lado, a la administración de recursos materiales, servicios básicos y generales, considerando las normas y procedimientos para la adquisición y mantenimiento de los bienes muebles e inmuebles. \n\nAsimismo, con relación a la gestión de recursos financieros, en 2022 se atenderá el registro y análisis de las operaciones financieras, contables e instrucciones de pago, así como la elaboración de los estados financieros de la Comisión, informes y reportes internos y externos en materia de rendición de cuentas. Para el desarrollo de estas acciones se requiere de la articulación con el área de presupuesto, así como atender a las disposiciones aplicables, al calendario del ejercicio del presupuesto autorizado, y otras disposiciones de la SHCP. 	12	1210	\N	\N	\N	\N	1118	1114	1123	2371	1	\N	7	\N
