12	La Comisión Nacional para la Mejora Continua de la Educación tiene como antecedente al extinto Instituto Nacional para la Evaluación de la Educación (INEE) creado en 2002; el cual tenía por objetivo la coordinación del Sistema Nacional de Evaluación Educativa y la evaluación de la calidad del SEN en la educación básica y media superior, correspondiente a componentes, procesos o resultados; los atributos de educandos, docentes y autoridades escolares, y las características de instituciones, políticas y programas educativos, con el fin de alcanzar la calidad educativa.  \n\nEste instituto operaba a partir de cinco programas presupuestarios de carácter sustantivo, uno administrativo y uno más destinado a la Función Pública y el buen gobierno. Cada programa sustantivo centraba sus esfuerzos en acciones estratégicas derivadas de las atribuciones del instituto.\n	Las autoridades educativas federales y locales promueven de manera limitada la mejora continua de la educación	En este contexto, la reforma del artículo tercero significó la extinción del INEE y el inicio de operaciones de Mejoredu, así como un viraje en la orientación de la política educativa en México, la cual tránsito de la búsqueda de la mejora de la calidad educativa a garantizar el derecho a la educación y promover la mejora continua de la educación. \n\nLa Ley Reglamentaria del artículo 3º Constitucional fue emitida el 30 de septiembre de 2019, por lo que a partir de 2020 Mejoredu opera con tres programas presupuestales, uno de carácter sustantivo, uno administrativo y una más orientado a las actividades de apoyo a la Función Pública.	El Decreto por el que se reforman, adicionan y derogan diversas disposiciones de los artículos 3º, 31 y 73 de la Constitución de los Estados Unidos Mexicanos, en materia educativa (15 de mayo, 2019) establece a la educación como un derecho que debe ser garantizado por el Estado:\nArtículo 3º Toda persona tiene derecho a la educación. El Estado -Federación, Estados, Ciudad de México y Municipios- impartirá y garantizará la educación inicial, preescolar, primaria, secundaria, media superior y superior.\nFracción e. Será equitativo, para lo cual el Estado implementará medidas que favorezcan el ejercicio pleno del derecho a la educación de las personas y combatan las desigualdades socioeconómicas, regionales y de género en el acceso, tránsito y permanencia en los servicios educativos.\nEsta reforma política y constitucional implicó la transformación del enfoque sobre educación, ahora planteada como un derecho y un bien público, en tanto permite conocer, ejercer y defender el ejercicio de éste y otros derechos humanos, promover el principio de igualdad en el ejercicio de derechos, incrementar las capacidades y competencias de las personas y, en consecuencia, propiciar el desarrollo económico, técnico, científico y social en el país .\nGarantizar el derecho a la educación implica, entre otros, coordinar el trabajo de autoridades, instituciones y actores educativos para brindar espacios y servicios educativos en todo el país, optimizar la infraestructura para favorecer el aprendizaje, promover una educación accesible, aceptable e inclusiva; así como propiciar espacios de desarrollo para docentes, directivos y otros actores. 	Nacional	Se considera a la población potencial que participa en el nivel de educación básica (prescolar, primaria y secundaria) y nivel de educación media superior (bachillerato general, tecnológico, profesional técnico y capacitación para el trabajo), así como en la modalidad escolar, no escolarizada y mixta. En ésta se incluye la educación indígena, la orientada a la población migrante y para adultos. Por lo tanto, la población potencial está definida por los actores claves de la mejora continua de la educación, entendidos como estudiantes, maestras y maestros, autoridades escolares, madres, padres de familia y tutores, personal de acompañamiento y apoyo pedagógico, profesoras y profesores formadores de docentes, equipos técnicos formadores de docentes, autoridades educativas locales, autoridad educativa municipal y Organismos públicos descentralizados, que participan en la educación básica, media superior y superior en sus distintos tipos y modalidades.	Para efectos de la caracterización de la población objetivo se considera que las autoridades educativas son las personas que “[…] ocupan puestos de autoridad en la SEP” así como en “las secretarías de educación de las entidades federativas o instituciones y organismos homólogos” (Mejoredu, 2020:43), es decir, titulares de las instituciones responsables en materia educativas, que pueden ser secretarías o institutos de educación, así como aquellos que tienen el cargo inmediato inferior exceptuando aquellas administrativas-financieras. Por lo tanto la población objetivo que atiende el Pp P016 son las autoridades educativas federal, estatales de educación básica y media superior y los organismos descentralizados que imparten educación media superior	Para la cuantificación de la población objetivo se emplea la referencia de la normatividad federal y estatal en materia de educación que definen a las autoridades educativas, así como la información pública de la estructura orgánica de cada institución que cumple con la caracterización antes mencionada.\n\nConsiderando lo expuesto con antelación, la población objetivo se estima en cuatro servidores públicos federales conformada por las personas titulares de la Secretaría de Educación Pública y de las subsecretarías de Educación Básica y Educación Media Superior	Sexenal	A partir del conocimiento generado, la Comisión puede elaborar lineamientos, criterios, sugerencias, programas de formación y materiales educativos orientados a la mejora del SEN, que son dirigidos para su implementación a las autoridades educativas. Estos productos atenderán a los principios de equidad e inclusión, reconociendo la diversidad cultural y étnica como las desigualdades y necesidades educativas específicas, tal como se plantea en el artículo 3º constitucional.\nFinalmente, en su vinculación con las autoridades educativas en el marco del SNMCE y las propias acciones de vinculación interinstitucional que impulsa, Mejoredu posibilita el conocimiento, acceso y adecuación de los productos que genera para su implementación por las autoridades educativas en los contextos donde estos actores tienen incidencia, para ampliar el impacto en cambios positivos al SEN.\n	2024-08-20 18:56:10.78175	41	\N	\N	\N
