36	Cumplir con el horizonte de mejora es una tarea de largo plazo, reconociendo que, en el proceso, debe brindarse atención constante a las necesidades de los actores clave en el ámbito educativo.\nEn este sentido busca que la educación se caracterice por: • Un enfoque de derechos de las NNAJ, cuya garantía es obligación del Estado. Para el caso de las NNAJ, esto implica asegurarles el acceso a los centros escolares, su permanencia, tránsito y egreso de los niveles educativos obligatorios, y el aprendizaje de contenidos pertinentes, significativos y relevantes. Este enfoque supone adherirnos al principio de igualdad sustantiva y respetar, proteger, reconocer y priorizar el interés superior de las niñas, los niños y adolescentes. • Una visión humanista como bien público, cuyo valor –lejos de restringirse al impacto positivo en la economía– radica en su potencial para promover el florecimiento humano de cada niña, niño, adolescente o joven, el desarrollo armónico de todas sus facultades, la construcción de comunidades y la formación de una sociedad de bienestar. • Una mejora continua como prioridad. Esto implica situar a la evaluación educativa como uno de los medios para la fundamentación de dichas orientaciones y para que los actores educativos, las instituciones y escuelas identifiquen sus necesidades, retos y avances. A partir de ahí, lo prioritario es emprender procesos que propicien los ajustes o cambios que se requieren en la práctica para satisfacer esas necesidades, afrontar los retos y sostener o acrecentar los avances. • Se promuevan desde las escuelas y centros educativos, las iniciativas para propiciar un cambio educativo sostenible y pertinente para el contexto en que se ubiquen. • Una revalorización del trabajo docente, en particular, reconocer a las maestras y los maestros como profesionales cuyas habilidades, conocimientos y saberes, no sólo son resultado de una formación específica, sino también de su experiencia cotidiana en el aula y la escuela, y del desarrollo de su capacidad para vincularse y comprometerse con la comunidad y el entorno en donde laboran. • La inclusión, participación y colaboración, lo que implica admitir el punto de vista de diversos actores educativos y de la sociedad en general y, particularmente, de aquellos a quienes se dirijan las orientaciones. • Ser integral y de excelencia, que impulse al máximo el logro de aprendizaje de todos los alumnos. • Promover la ciudadanía plena, la sana convivencia y la paz en los diversos contextos sociales y escolares. Lo anterior podrá ser posible, con las bases en política educativa que la actual administración está construyendo. Se espera que, a partir de 2024, las acciones desarrolladas en este periodo de gobierno generen mecanismos eficaces de coordinación entre las autoridades educativas estatales y federales, conocimiento y herramientas a disposición de los actores clave del proceso educativo para mejorar los aprendizajes de los alumnos, conviertan a las escuelas en espacios inclusivos y de excelencia, fortalezcan el desarrollo profesional docente, mejoren las políticas educativas y difundan de manera eficaz los productos y herramientas que sean generadas o impulsadas por la MEJOREDU. 	C	38	\N	\N	948
38	epílogo	C	40	\N	\N	1048
39	Cumplir con el horizonte de mejora es una tarea de largo plazo, reconociendo que, en el proceso, debe brindarse atención constante a las necesidades de los actores clave en el ámbito educativo.\n\nDe acuerdo con datos del CONAPO29, la tasa de crecimiento poblacional total empieza a disminuir a partir de 2016, la cual se estimó de 1.1%, bajando a 0.62% para 2030 y a 0.1% en 2050.\n\nEsta disminución tiene un reflejo directo en la población estudiantil. Se estima que para 2030, la población en educación inicial, correspondiente a las edades de 3 a 5 años, disminuirá a 6 087 314 personas, en 2050 se prevé sean 5 190 425, lo cual representa una disminución de 14.7 por ciento en el peso relativo de este grupo de edad respecto al año 2030.\n\nAsimismo, la demanda potencial del nivel de educación primaria, niñas y niños de 6 a 11 años de edad, disminuirá a 12 544 591 personas en 2030 y a 10 754 671 en 2050.\nLa tendencia de la población proyectada entre 12 y 14 años de edad, referencia para educación secundaria, presenta un comportamiento similar, se espera que disminuya a 6 462 871 en 2030 y a 5 557 502 en 2050.\nLa población entre 15 y 17 años de edad que corresponde al nivel medio superior, se estima que presentará una disminución a 6 528 588 en 2030 y se reducirá a 5 656 357 jóvenes en 2050.\n\nLas personas de 18 a 24 años de edad constituyen la población objetivo de la educación superior, se espera que el volumen se reduzca a 15 134 306 jóvenes en 2030, y a 13 464 702 en 2050.\n\nLas tendencias del volumen y proporción de los grupos de edades escolares conllevan a enfocar de manera adecuada las políticas y programas. La disminución generalizada de la población estudiantil va quitando presión a la cobertura y aumentando la necesidad de contar con mayor calidad y equidad; elevando el reto de logar la permanencia y retención de los alumnos en el transcurso de su trayectoria escolar.\n\nPor ello, la Visión de la Comisión es ser una institución reconocida socialmente por sus aportaciones en materia de mejora continua, orientadas a la consolidación de comunidades escolares como espacios formativos inclusivos, interculturales y de excelencia, que garantizan el ejercicio pleno del derecho a la educación básica y media superior en México.\n\n\n	C	37	\N	\N	\N
