36	2024-09-25	13:33:20.653	anabell.martinez	Programa Institucional 2020-2024 de la Comisión Nacional para la Mejora Continua de la Educación	La educación es decisiva para definir la posibilidad de progreso que tiene una sociedad y para alcanzar el bienestar de todos sus miembros. Un gobierno nacional que busca reducir las desigualdades sociales y que tiene como premisa fundamental lograr el bienestar general de la población a partir de un nuevo modelo de desarrollo requiere encontrar los mecanismos para el logro de la equidad y la excelencia educativa. En nuestro país, en el último siglo grandes sectores de la población han tenido un acceso progresivo a los diferentes niveles y modalidades educativas. Sin embargo, el Sistema Educativo Nacional (SEN) aún no asegura que todas las Niñas, Niños, Adolescentes y Jóvenes (NNAJ) tengan un desarrollo integral, y aún existen grandes disparidades en el acceso y el logro de aprendizajes pertinentes y relevantes que reciben los diferentes grupos sociales.\n\nDurante el siglo XX, el crecimiento de la oferta educativa buscó de manera destacada hacer accesible la educación a toda la población; se logró con ritmos distintos, en función del tipo y nivel educativo y la entidad federativa. La escolarización obligatoria abarcó fundamentalmente la educación primaria y fue hasta 1993 que se amplió a la educación secundaria, en 2004 a la educación preescolar, en 2013 a la educación media superior y en 2019 a la educación superior. Estas reformas constitucionales tuvieron como consecuencia que en apenas tres décadas la obligatoriedad de la educación pasara de 6 a 19 años.\n\nAl inicio del ciclo escolar 2017-2018, el SEN1 contó con más de 36.4 millones de alumnos, de los cuales 30.6 millones asistían a educación básica y media superior, en 244,117 escuelas, mismos que fueron atendidos por 1,519,322 docentes. Destaca que, del total de alumnos, el 69.8% (25,447,467) se matriculó en la educación básica y el 14.4% (5,237,003) en educación media superior. En particular, en educación especial fueron atendidos 572,852 alumnos, por 40,614 docentes. En educación básica se atendieron a poco más de 2.6 millones de alumnos en preescolares y primarias indígenas, así como en telesecundarias.	La totalidad de las acciones que se consideran en este Programa, incluyendo aquellas correspondientes a sus Objetivos prioritarios, Estrategias prioritarias y Acciones puntuales, así como las labores de coordinación interinstitucional para la instrumentación u operación de dichas acciones y el seguimiento y reporte de las mismas, se realizarán con cargo al presupuesto autorizado de los ejecutores de gasto participantes en el Programa, mientras éste tenga vigencia	695	C	\N	\N	11	\N	2024	\N	\N	\N
